function filterCars(selectedCategory, selectedSubCategory , cars, setCars) {
    const result = cars.filter((curCar) => {
        return curCar.category === selectedCategory && curCar.seats === selectedSubCategory
    });
    setCars(result);
}

export default filterCars;
